class 'ServicoEntrega'

function ServicoEntrega:__init()

	self.telaFretes = TelaFretes()
	self.mercadoriasLiberadas = {}
	self.categoriasVeiculos = CategoriaVeiculos()
	self.entregas = {}
	self.stats = {}
	
	self.timer = Timer()
	self.timerDelay = Timer()
	self.timerExpiracao = Timer()
	self.timerPressionandoJ = Timer()
	self.emDescarga = false
	
	self.tempoComecei = 36
	self.comecei = false
	
	self.emMenuCarregar = false
	self.veiculoValidado = nil
	
	self.veiculoEntrega = nil
	self.categoriaAtual = 1
	
	self.carregado = false -- / Entrega
	self.descargaAtual = 2
	self.pagamentoEntrega = 0
	
	
	self.pressionandoJ = false
	
	self.validadorEntrega = nil


	self.foraVeiculo = false
	self.tempoForaVeiculo = 30
	
	self.iconeEntrega = Image.Create(AssetLocation.Base64, "")
	self.iconeEntrega:SetSize(	self.iconeEntrega:GetSize() / 12)
	
	
	self.spotsEntregas = {}
	

	Events:Subscribe("PostRender", self, self.Render)
	Events:Subscribe("KeyDown", self, self.KeyDown)
	Events:Subscribe("KeyUp", self, self.KeyUp)
	Events:Subscribe("PostTick", self, self.PostTick)
	Events:Subscribe("LocalPlayerEnterVehicle", self, self.LocalPlayerEnterVehicle)
	Events:Subscribe("LocalPlayerExitVehicle", self, self.LocalPlayerExitVehicle)

	Network:Subscribe("AtualizarDados", self, self.AtualizarDados)
	Network:Subscribe("PodeCarregar", self, self.PodeCarregar)
	Network:Subscribe("Carregado", self, self.Carregado)	
end


function ServicoEntrega:LimparEntrega()

	self.foraVeiculo = false
	self.emDescarga = false
	if self.validadorEntrega then
		self.validadorEntrega:Finalizar()
		self.validadorEntrega = nil
	end
	self.carregado = false
	self.emMenuCarregar = false
	self.veiculoValidado = nil
	self.veiculoEntrega = nil
	self.descargaAtual = 2
	self.pagamentoEntrega = 0
	Waypoint:Remove()
	self.tempoComecei = 3 
	self.comecei = false
	
end


function ServicoEntrega:GetCategoriaMercadoria(mer)

	for _, m in pairs(self.mercadoriasLiberadas) do
	
		if m.idMercadoria == mer then
			return m.idCategoria
		end
	
	end
	return nil

end


function ServicoEntrega:GetMercadoriaCategoriaAtual(mercadorias)

	if not mercadorias then return nil end
			
	for m, b in pairs(mercadorias) do
		
		for _, tM in pairs(self.mercadoriasLiberadas) do
			if tonumber(tM.idMercadoria) == tonumber(m) then


				if tonumber(tM.idCategoria) == self.categoriaAtual then
			

					return b
				end
				
			end
	
		end
		
	end
	return nil

end


function ServicoEntrega:AlterarCategoria(cat)

	self.categoriaAtual = cat

end


function ServicoEntrega:Carregado(args)

	-- self:LimparEntrega()
	self.tempoComecei = 6 
	self.comecei = false
	
	self.veiculoEntrega = {args.veiculo, args.veiculoProprio}

	self.carregado = self.emDescarga

	self.carregado:SetMercadoria(args.mercadoria)
	
	self.carregado.pagamentoMercadoria = tonumber(args.mercadoria.valor)
	
	local capacidade = self.categoriasVeiculos:GetCapacidadeVeiculo(args.modelId)
	self.carregado.capacidadeMinima = capacidade

	
	self.pagamentoEntrega = self.carregado.pagamento * self.carregado.distancia / 1000 * capacidade * self.carregado.pagamentoMercadoria
	
	if tonumber(args.mercadoria.tipoMercadoria) == 2 then
	
		self.validadorEntrega = EntregaFragil({tolerancia = args.mercadoria.valorTipo, idVeiculo = args.veiculo})
	elseif tonumber(args.mercadoria.tipoMercadoria) == 4 then

		self.validadorEntrega = EntregaPerecivel({tempo = self:CalcularTempoPercurso(self.carregado.distancia) + 20})
	end

	Waypoint:SetPosition(self.carregado.descargas[self.descargaAtual])
	
	
	
end


function ServicoEntrega:CalcularTempoPercurso(distancia)

	local velocidadeMediaPorSegundo = 66
	if self.stats[self.categoriaAtual] then
		local velocidadeMediaPorSegundo = tonumber(self.stats[self.categoriaAtual].velocidadeMedia)
	end
	-- local velocidadeMediaPorSegundo = self.categoriasVeiculos:GetVelocidadeCategoriaVeiculo(veiculo) / 3.6
	
	return distancia / velocidadeMediaPorSegundo
	
end


function ServicoEntrega:PodeCarregar()
	
	-- se estiver em veiculo: "voce ira ser descontado blabla"
	if LocalPlayer:InVehicle() then
		
		if self.veiculoValidado != LocalPlayer:GetVehicle() then
			Chat:Print("O veiculo que esta nao pode ser utilizado!", Color(255,0,0))
			return
		end
		
	
	else
		-- dar veiculo aleatorio
	
	end

end


function ServicoEntrega:Falhou()

	if not self.carregado then return end
	if not self.veiculoEntrega[2] then
		Network:Send("FalhouEntrega", {player = LocalPlayer, veiculo = self.veiculoEntrega[1]})
	end
	Chat:Print("Voce falhou na entrega!", Color(255,0,0))
	self:LimparEntrega()
end


function ServicoEntrega:Descarregar()
	
	if not self.carregado then return end
	
	if not LocalPlayer:InVehicle() or LocalPlayer:GetVehicle():GetId() != self.veiculoEntrega[1] then 
		Chat:Print("Voce precisa estar no veiculo do servico!", Color(255,0,0))
		return
	end
	
	if self.descargaAtual < #self.carregado.descargas then
		self.descargaAtual = self.descargaAtual + 1
		Chat:Print("Voce descarregou um! Resta(m) ".. #self.carregado.descargas - self.descargaAtual, Color(255,255,200))
		Waypoint:SetPosition(self.carregado.descargas[self.descargaAtual])
	else
		
		local desconto = 0
		if self.validadorEntrega then
			desconto = self.validadorEntrega:GetDesconto()
		end

		local pagamento = self.carregado.pagamento * self.carregado.distancia / 1000 * self.carregado.capacidadeMinima * self.carregado.pagamentoMercadoria
		pagamento = pagamento - pagamento * desconto
		Network:Send("Descarregar", {player = LocalPlayer, percentual = self.carregado.pagamento, distancia = self.carregado.distancia, pagamento = pagamento, mercadoria = self.carregado.mercadoria, veiculo = self.veiculoEntrega[1], veiculoProprio = self.veiculoEntrega[2]})
		self:LimparEntrega()		
		if desconto > 0 then
			Chat:Print("Voce foi descontado em ".. tostring(args.desconto) * 100 .."% pelos danos na entrega!", Color(255,0,0))
			
		end		


	end
	
end


function ServicoEntrega:PressionouJ(boo)

	self:PressionarJ(false)

	if self.emDescarga then

		if self.carregado then

			
			self:Descarregar()

		else
		
			local veiculo = LocalPlayer:GetVehicle()
				
			local mercadoriaEntrega = self:GetMercadoriaCategoriaAtual(self.emDescarga.mercadorias)

			if veiculo then
					
				if (not mercadoriaEntrega) then
					Chat:Print("Nao possuem mercadorias disponiveis para seu tipo de veiculo!", Color(255,0,0))
						
					return
				end
					
				-- if (not self.categoriasVeiculos:ValidaVeiculoMercadoriaEntrega(veiculo:GetModelId(), tonumber(mercadoriaEntrega.idMercadoria))) then
					-- Chat:Print("Este veiculo nao pode ser usado para transportar esse tipo de carga!", Color(255,0,0))
					
					-- return
				-- end
				
			end

			Network:Send("QueroCarregar", {player = LocalPlayer, entrega = self.emDescarga.id, veiculo = veiculo, mercadoria = mercadoriaEntrega, categoria = self.categoriaAtual})
		end
		
	end
			
end


function ServicoEntrega:PressionarJ(boo)
	self.timerDelay:Restart()

	if boo then
		self.timerPressionandoJ:Restart()

	end
	self.pressionandoJ = boo
		
end


function ServicoEntrega:KeyUp(args)

	if args.key == string.byte("J") then
	
		self:PressionarJ(false)
	end

end


function ServicoEntrega:KeyDown(args)

	if args.key == string.byte("J") then
	
		if self.pressionandoJ then return end
		
		if self.timerDelay:GetSeconds() < 0.09 then return end
		
		if self:GetEmDescarga() then
			self:PressionarJ(true)
		end
		return
	end
	
	if args.key == string.byte("O") then
	
		if self.carregado then
		
			if self.carregado.descargas[self.descargaAtual] then
				Waypoint:SetPosition(self.carregado.descargas[self.descargaAtual])
				if LocalPlayer:GetValue("Lingua") == 1 then
					Chat:Print("Your GPS was set to the point of unloading!", Color(255,255,0))
				else
					Chat:Print("Seu GPS foi remarcado para o ponto do descarregamento!", Color(255,255,0))
				end
			end
		end
	end

end


function ServicoEntrega:GetEmDescarga(retorno)
	
	if self.carregado then
	
		if Vector3.Distance(LocalPlayer:GetPosition(), self.carregado.descargas[self.descargaAtual]) < 6 then
			if retorno then
				return self.carregado
			end
			return true		
		end
		
	else
	
		for _, e in pairs(self.entregas) do
		
			if Vector3.Distance(LocalPlayer:GetPosition(), e.descargas[1]) < 6 then
			
				local mercadoria = self:GetMercadoriaCategoriaAtual(e.mercadorias)
				if not mercadoria then
					return false

				end
				
				if retorno then
					return e
				end
				return true
				
				
			end
		
		end

	end
	
	return false

end


function ServicoEntrega:AtualizarDados(args)

	self.telaFretes:Limpar()
	self.stats = {}
	self.mercadoriasLiberadas = {}
	self.entregas = {}
	
	
	if not args then return end
	
	if args.mercadorias	then
		self.mercadoriasLiberadas = args.mercadorias --idMercadoria
	end


	if args.entregas then
		self.entregas = self:GetEntregasMercadoriasLiberadas(args.entregas)
	
	end
	
	if args.stats then
		for _, c in pairs(args.stats) do
		
			self.stats[tonumber(c.idCategoria)] = c
			self.telaFretes:AddCategoria({idCategoria = tonumber(c.idCategoria), nome = c.nome})

		end
	end
	
	self.telaFretes:SetEntregas(self.entregas)
	
end


function ServicoEntrega:GetEntregasMercadoriasLiberadas(entregas)
	
	local entregasRetorno = {}
	
	for _, e in pairs(entregas) do

		local entregaObject = Entrega({id = e.id, pagamento = e.pagamento, tempo = e.tempo, angulo = e.angulo, descargas = e.descargas, tempoPercurso = e.tempoPercurso, distancia = e.distancia})

		for _2, mL in pairs(self.mercadoriasLiberadas) do
			
			if e.mercadorias[tonumber(mL.idMercadoria)] then
				
				entregaObject:AddMercadoria(mL.idMercadoria, mL)

			end
			
		end
		
		if entregaObject:GetCountMercadorias() > 0 then
			
			table.insert(entregasRetorno, entregaObject)	
				
		end
		
	end
	
	return entregasRetorno

end


function ServicoEntrega:PostTick()
	
	if self.pressionandoJ then
		if self.timerPressionandoJ:GetSeconds() > 2 then

			self:PressionouJ()
		end
	end
	
	if self.timer:GetSeconds() > 1 then
	
		if not self.comecei then
			self.tempoComecei = self.tempoComecei - 1 
			if self.tempoComecei <= 0 then
			
				self.comecei = true
				Network:Send("Comecei", LocalPlayer)
			end
		end	
		if self.foraVeiculo then
		
			self.tempoForaVeiculo = self.tempoForaVeiculo - 1
			if self.tempoForaVeiculo <= 0 then
			
				self:Falhou()
			
			end
		end
	
		self.emDescarga = self:GetEmDescarga(true)
		
		
		self.timer:Restart()
	end
	
	if self.timerExpiracao:GetMinutes() > 2 then
			
		for _, e in pairs(self.entregas) do
		
			e.tempo = e.tempo - 2
			if e.tempo <= 0 then
				table.remove(self.entregas, _)
			end
		
		end
		self.timerExpiracao:Restart()
	end

end


function ServicoEntrega:DrawText(pos, text, cor, size)

	if not size then
		size = 15
	end
	Render:DrawText(Vector2(1,1) + pos, text, Color(0,0,0,120), size)
	Render:DrawText(pos, text, cor, size)

end


