						Render:FillTriangle(posTexto - Vector2(60,80)* textScale, posTexto + Vector2(60, -80) * textScale, posTexto + Vector2(0, -30)* textScale, color - Color(0,0,0, 55))
								
						if dist < 32 then
							
							if suc then
							

								size = size * textScale
								
								
								local txt = "Sem mercadorias para a categoria selecionada"
								local color2 = Color(242, 38, 19)

								if mercadoriaAtual then
									txt = string.upper(tostring(mercadoriaAtual.nome))
									color2 = Color(25, 181, 254)
								end
								
								self:DrawText(posTexto - Render:GetTextSize(txt, size) / 2, txt, color2, size)
							end
						end
					end
					
				end
			
			end	
		end	
	
	end
	
	if self.telaFretes then
		self.categoriaAtual = self.telaFretes:GetCategoriaAtual()
	end

end


function ServicoEntrega:LocalPlayerExitVehicle(args)

	if self.carregado then
		
		if args.vehicle:GetId() == self.veiculoEntrega[1] then
				
			self.tempoForaVeiculo = 30		
			self.foraVeiculo = true
		
		end
	end

end


function ServicoEntrega:LocalPlayerEnterVehicle(args)

	if self.carregado then
	
		if args.vehicle:GetId() == self.veiculoEntrega[1] then

			self.foraVeiculo = false
		
		end
	end
	
end


servicoEntrega = ServicoEntrega()
